import Navbar from './Navbar';
import './header.css';

function Header() {
  return (
    <header class="header" id="header">
        <div class="top">
            <div class="banner" id="banner">
                Scegli tua nuova casa in un contesto unico, dove l'heritage del luogo incontra il design contemporaneo. <a href="#contatti">CONTATTACI</a>
            </div>
            <Navbar />
        </div>
        <div class="text-header">
            <div class="title">Zenit, abitare iconico</div>
            <div class="paragraph">
                Dopo il successo dei primi due progetti residenziali, <strong>Manifattura Tabacchi presenta Zenit.</strong><br />
                Appartamenti dal design ricercato con <strong>ampi spazi esterni</strong> esclusivi. <a href="#"><strong>Scopri il progetto.</strong></a>
            </div>
        </div>
        <div class="scopri">
            <a href="#" class="scopri-testo">SCOPRI DI PIÃ™</a>
            <div class="linea-verticale"></div>
        </div>
    </header>
  );
}

export default Header;
